template <bool B>
inline bool VerifyFileOrData(::flatbuffers::VerifierTemplate<B> &verifier, const void *obj, FileOrData type) {
  switch (type) {
    case FileOrData::NONE: {
      return true;
    }
    case FileOrData::FileReference: {
      auto ptr = reinterpret_cast<const DeepSeaVectorDraw::FileReference *>(obj);
      return verifier.VerifyTable(ptr);
    }
    case FileOrData::RawData: {
      auto ptr = reinterpret_cast<const DeepSeaVectorDraw::RawData *>(obj);
      return verifier.VerifyTable(ptr);
    }
    default: return true;
  }
}

template <bool B>
inline bool VerifyFileOrDataVector(::flatbuffers::VerifierTemplate<B> &verifier, const ::flatbuffers::Vector<::flatbuffers::Offset<void>> *values, const ::flatbuffers::Vector<FileOrData> *types) {
  if (!values || !types) return !values && !types;
  if (values->size() != types->size()) return false;
  for (::flatbuffers::uoffset_t i = 0; i < values->size(); ++i) {
    if (!VerifyFileOrData(
        verifier,  values->Get(i), types->GetEnum<FileOrData>(i))) {
      return false;
    }
  }
  return true;
}

